@icebox.college , Okinawa Milk Tea with boba ⤵️
//⚫️⚫️⚪️⚪️⚪️//
2/5 stars 

This is only the second time I’ve been to this self serve boba place and unfortunately it was not as good as I remember. Perhaps it’s due to the fact that right now it’s not actually self serve, but the boba was hard and tasteless and although the cup is very cute, ITS JUST SO MUCH BOBA. Coming from @milkteagirls that is quite a statement. 

-M

